import "./App.css";
import React, { Component } from "react";

export default class App extends Component {
	render() {
		return (
			<div className="App">
				<header>
					<div>

						<h1>header</h1>
					</div>
				</header>
				<main>
					<h1>main</h1>
				</main>
				<footer>
					<h1>footer</h1>
				</footer>
			</div>
		);
	}
}
